import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="main-footer">
      <div className="footer-left">
        MIT Copyright &copy; 2019 <div className="bullet"></div> Web Sites by
        <a href="https://freelancedon.ca/">Don Milligan</a>
      </div>
      <div className="footer-right">
        2.3.0
      </div>
    </footer>
  );
};

export default Footer;
